import React from 'react';
import companyLogo from './images/companyLogo.png';
import location from './images/location.png';
import endDate from './images/endDate.png';
import startDate from './images/startDate.png';
import pound from './images/pound.png';
import internetPage from './images/internet.png';
import code from './images/code.png';
import './style.css';
const CardComp = (props) => {
    return (
        <div className="card">
            <div>
                <h3 className="subjectName">Mathmatics</h3>
                 <img  className="imageCard" src={companyLogo} alt="company logo" />
            </div>
            <div>
                <h3 className="cardTitle">Quantity Surveying Management Trainee Programme with SES</h3>
                <div className="cardDitails">

                     <div className="cardLine">
                       Country: <img src={location} alt="location"/> London
                       Post Code:<img src={code} alt="code"/> + 44
                     </div>

                    <div className="cardLine"> 
                       <img src={startDate} alt="startDate"/> 10/01/2019
                       <img src={endDate} alt="endDate"/> 20/01/2019
                    </div>

                    <div className="cardLine">
                       <h4><img src={pound} alt="pound"/> 15 / Day</h4>
                       <h4><img src={internetPage} alt="internetPage"/> www.unicornz.uk</h4>
                    </div>
                 </div>
            </div>
        </div>
    )
}

export default CardComp;
